import React from "react";
import {
  Container,
  Input,
  InputConatiner,
  LogoImg,
  Menu,
  MenuRight,
  Row,
  Wrapper,
} from "./styles";
import Button from "../button";

const Header = () => {
  return (
    <Wrapper>
      <Container>
        <Row>
          <LogoImg src="./logo.webp" alt="logo" />
          <InputConatiner>
            <Input placeholder="buscar..." />
          </InputConatiner>
          <Menu>live code</Menu>
          <Menu>Global</Menu>
        </Row>
        <Row>
          <MenuRight href="#">Home</MenuRight>

          <Button title="Entrar"  variant='primary'/>
          <Button title="Cadastrar-se" />
        </Row>
      </Container>
    </Wrapper>
  );
};

export { Header };
